// Get AutoDS quotes from the AutoDS JSON Input node
const autodsQuotes = $('AutoDS JSON Input').all().map(item => item.json);

// Get WooCommerce products from the current input
const wooProducts = $input.all();

// Build lookup map by WooCommerce product ID (as string)
const wooLookup = {};
for (const item of wooProducts) {
  const product = item.json;
  const productId = String(product.id);
  wooLookup[productId] = product;
}

// Match and merge
const results = [];
for (const quote of autodsQuotes) {
  const siteId = String(quote.item_id_on_site || '');
  const wooProduct = wooLookup[siteId];

  if (!wooProduct) {
    continue; // Skip items without a WooCommerce match
  }

  // Extract cost price (try multiple field names for robustness)
  const costPrice = parseFloat(quote.buy_price || quote.cost || quote.price || 0);
  const shippingCost = parseFloat(quote.shipping_cost || 0);

  // Extract WooCommerce product details
  const categories = (wooProduct.categories || []).map(c => c.name).join(', ');
  const tags = (wooProduct.tags || []).map(t => t.name).join(', ');
  const productImage = wooProduct.images && wooProduct.images.length > 0 ? wooProduct.images[0].src : '';

  results.push({
    json: {
      productId: wooProduct.id,
      autodsProductId: quote.product_id,
      costPrice: costPrice,
      shippingCost: shippingCost,
      currentName: wooProduct.name || '',
      currentDescription: wooProduct.description || '',
      currentPrice: parseFloat(wooProduct.price || 0),
      currentRegularPrice: parseFloat(wooProduct.regular_price || 0),
      categories: categories,
      tags: tags,
      productUrl: wooProduct.permalink || '',
      productImage: productImage
    }
  });
}

return results;

// Extract the Gemini response text
const geminiResponse = $json;
let responseText = '';

try {
  responseText = geminiResponse.candidates?.[0]?.content?.parts?.[0]?.text || '';
} catch (e) {
  responseText = '';
}

// Get original data from Match Products
const matchData = $('Match Products').first().json;

// Try to parse JSON from the response text
let enhancedName = matchData.currentName;
let enhancedDescription = matchData.currentDescription;

try {
  // Use regex to find JSON object in the response
  const jsonMatch = responseText.match(/\{[\s\S]*?"enhancedName"[\s\S]*?"enhancedDescription"[\s\S]*?\}/);
  if (jsonMatch) {
    const parsed = JSON.parse(jsonMatch[0]);
    enhancedName = parsed.enhancedName || enhancedName;
    enhancedDescription = parsed.enhancedDescription || enhancedDescription;
  }
} catch (e) {
  // Fall back to original name/description if parsing fails
}

return [{
  json: {
    productId: matchData.productId,
    autodsProductId: matchData.autodsProductId,
    costPrice: matchData.costPrice,
    shippingCost: matchData.shippingCost,
    currentName: matchData.currentName,
    currentDescription: matchData.currentDescription,
    currentPrice: matchData.currentPrice,
    currentRegularPrice: matchData.currentRegularPrice,
    categories: matchData.categories,
    tags: matchData.tags,
    productUrl: matchData.productUrl,
    productImage: matchData.productImage,
    enhancedName: enhancedName,
    enhancedDescription: enhancedDescription
  }
}];

// Parse Gemini pricing response
const geminiResponse = $json;
let responseText = '';

try {
  responseText = geminiResponse.candidates?.[0]?.content?.parts?.[0]?.text || '';
} catch (e) {
  responseText = '';
}

// Get accumulated data from Parse Marketing Review
const prevData = $('Parse Marketing Review').first().json;

// Default pricing values
let recommendedPrice = prevData.currentPrice;
let totalCost = prevData.costPrice + prevData.shippingCost;
let marginPercent = 0;
let isProfitable = false;
let priceVerdict = 'NOT_PROFITABLE';

try {
  // Use regex to find JSON object in the response
  const jsonMatch = responseText.match(/\{[\s\S]*?"recommendedPrice"[\s\S]*?\}/);
  if (jsonMatch) {
    const parsed = JSON.parse(jsonMatch[0]);
    recommendedPrice = parsed.recommendedPrice || recommendedPrice;
    totalCost = parsed.totalCost || totalCost;
    marginPercent = parsed.marginPercent || marginPercent;
    isProfitable = parsed.isProfitable || false;
    priceVerdict = parsed.priceVerdict || priceVerdict;
  }
} catch (e) {
  // Use defaults if parsing fails
  marginPercent = ((prevData.currentPrice - totalCost) / prevData.currentPrice) * 100;
  isProfitable = marginPercent >= 15;
  priceVerdict = isProfitable ? 'PROFITABLE' : 'NOT_PROFITABLE';
  if (!isProfitable) {
    recommendedPrice = Math.ceil((totalCost / 0.8) * 100) / 100; // 20% margin
  }
}

// Determine status based on profitability
const status = isProfitable ? 'publish' : 'draft';

// Track what fields were updated
const updatedFields = [];
if (prevData.enhancedName !== prevData.currentName) updatedFields.push('name');
if (prevData.enhancedDescription !== prevData.currentDescription) updatedFields.push('description');
if (recommendedPrice !== prevData.currentPrice) updatedFields.push('price');
if (status === 'draft') updatedFields.push('status');

return [{
  json: {
    productId: prevData.productId,
    autodsProductId: prevData.autodsProductId,
    currentName: prevData.currentName,
    currentDescription: prevData.currentDescription,
    currentPrice: prevData.currentPrice,
    enhancedName: prevData.enhancedName,
    enhancedDescription: prevData.enhancedDescription,
    recommendedPrice: recommendedPrice,
    totalCost: totalCost,
    costPrice: prevData.costPrice,
    shippingCost: prevData.shippingCost,
    marginPercent: marginPercent,
    isProfitable: isProfitable,
    priceVerdict: priceVerdict,
    status: status,
    updatedFields: updatedFields,
    processedAt: new Date().toISOString()
  }
}];
